How to update document with nested array in mongodb<p>I've got a document in a collection 'events' with the following structure:</p>

<pre><code>{ 
  "_id" : "abc",
  "text" : "some text",
}
</code></pre>

<p>I wish to update the document by inserting an array named guestOwner. The result I want would update the document like this:</p>

<pre><code>{ 
  "_id" : "abc",
  "text" : "some text",
  "guestOwner" : [
    {
        "name" : "JACK BLACK", 
        "guests" : [
            "GUEST1",
            "GUEST2"
        ]
    }
  ]
}
</code></pre>

<p>So I tried an mongo update with the following:</p>

<pre><code>db.events.update({ _id: eventid }, { $push: { guestOwner: { name: username, guests: allGuests } } });
</code></pre>

<p>where 'username' is a string, and 'allGuests' is an array of names ["Guest1", "Guest2"]</p>

<p>The issue for me is when a subsequent update to the document occurs, I would want to push a the new 'allGuests' array into the existing one if the name is the same. For example, if a second update occurs with 'allGuests' = ["GUEST3"], and with the same name = "JACK BLACK", I would want the document to be: </p>

<pre><code>{ 
  "_id" : "abc",
  "text" : "some text",
  "guestOwner" : [
    {
        "name" : "JACK BLACK", 
        "guests" : [
            "GUEST1",
            "GUEST2"
            "GUEST3"
        ]
    }
  ]
}
</code></pre>

<p>BUT, if the document were updated with a different name = 'JOHN SMITH' where allGuests array = ["GUEST3"], it would create:</p>

<pre><code>{ 
  "_id" : "abc",
  "text" : "some text",
  "guestOwner" : [
    {
        "name" : "JACK BLACK", 
        "guests" : [
            "GUEST1",
            "GUEST2"
        ]
    },
    {
        "name" : "JOHN SMITH", 
        "guests" : [
            "GUEST3"
        ]
    }
  ]
}
</code></pre>

<p>Would I need conditional statements surrounding the mongo update to check for guestOwner[0].name? Not sure if mongo could do this on its own, or if a bunch of logic is going to be necessary.  </p>

