MongoDB Join/Aggregate Query Returning Silence in Console<p>I have two collections in my MongoDB that I'd like to join with an aggregate query, but am having difficulty returning the resultant object(s) to the console.  It currently returns nothing, which, in itself, is strange.  Hoping you can help...</p>

<p><em>Collection 1 is <strong>scrapedData</strong> &amp; scrapes articles from the Chicago Tribune:</em></p>

<pre><code>{
"_id": ObjectId("123"),
"headline":"Cubs Javier Baez Wins Silver Slugger Award",
"link": "www.chicagotribune.com",
 }
</code></pre>

<p><em>Collection 2 is called <strong>comments</strong> and includes comments posted to my site linked to each article found from the scrape:</em></p>

<pre><code>  {
  "_id": ObjectId("456"),
  "articleId":"123",
  "author": "John Chicago"
  "message": "Good for Javier!"
  }
  {
  "_id": ObjectId("789"),
  "articleId":"123",
  "author": "Jane Q."
  "message": "MVP! MVP!"  
  }
</code></pre>

<p><em>My current attempt at pulling together a response from the database that joins article headline, and all comments related to it, is:</em></p>

<pre><code> db.comments.aggregate([
          {$match : {articleId : JSON.stringify(123)}},
          {
            $lookup:
              {
                from: "scrapedData",
                localField: "articleId",
                foreignField: "_id",
                as: "commentsPosted"
              }
         }
       ]),function(err, response) {
        if(err) {
          console.log(err); 
        } else {
          console.log(response);
        }
      }}); 
</code></pre>

<p>Any pointers you can share will be greatly appreciated.  </p>

