<p>I have next data structure.</p>

<pre><code>[
    {
        id: 1,
        shouldPay: true,
        users: [
            {
                id: 100,
                items: [{...}],
                tags: ['a', 'b', 'c', 'd']
            },
            {
                id: 100,
                items: [{...}],
                tags: ['b', 'c', 'd']
            },
            {
                id: 100,
                items: [{...}],
                tags: ['c', 'd']
            }
        ],

    }
]
</code></pre>

<p>In result I want to get something like that:</p>

<pre><code>[
    {
        id: 1,
        shouldPay: true,
        user: {
            id: 100,
            items: [{...}],
            tags: ['a', 'b', 'c', 'd']
        }

    }
]
</code></pre>

<p>The main idea is to select a specific user that has "a" letter or list of letters ['a', 'b'] in tags.</p>

