Mongoose $lookup count references<p>Here's my simplified schema for my MongoDB database that I'm working on:</p>

<pre><code>const podcastSchema: Schema = new Schema({
   name: { type: String, required: true },
   episodes: {
      type: [{
         title: { type: String, required: true },
      }],
      default: undefined
   }
},{
   timestamps: true
});
</code></pre>

<p>I've added a schema for stats, basically a listen count for each episode of the podcast:</p>

<pre><code>const statisticSchema: Schema = new Schema({
   connectionIdentifier: { type: String, required: true },
   episode: { type: Schema.Types.ObjectId, ref: 'Podcast.Episodes' }
},{
   timestamps: true
});
</code></pre>

<p>Now I need to join (left outer join actually) for each episode in podcast the count of items in stats, so I can have something like this:</p>

<pre><code>podcasts: {
   name: 'Lorem'
   episodes: [{
      title: 'Ipsum',
      played: 323
   },{
      title: 'Dolor',
      played: 12
   },
   ...
   ]
}
</code></pre>

<p>This is what I came from:</p>

<pre><code>const episodes = await Podcast.aggregate([
   { $match: { _id: podcastId } }, {
      $lookup: {
         from: 'statistics',
         localField: 'episodes._id',
         foreignField: 'episode',
         as: 'resultingEpisodeArray'
      }
   },{
      $unwind: { path: '$resultingEpisodeArray', preserveNullAndEmptyArrays: true }
   },{
      $group: {
         _id: null,
         episode: { $push: '$episodes' },
         played: { $sum: 1 }
      }
   },{
      $project: {
         _id: '$episode._id',
         title: '$episode.
         played: '$played'
      }
   }
]);
</code></pre>

<p>But it aggregate all podcast in a single one.
Where I'm failing?</p>

<p>Thanks for the help!</p>

